import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import App from "./App"
import Fylo from './Fylo';
import HeaderSection from './Header';
const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <HeaderSection></HeaderSection>
    <Fylo></Fylo>
  </React.StrictMode>
);

